import React from "react";
import Memory from "./memory/memory";
import { useSelector } from "react-redux";
const Memories = () => {
  const memories = useSelector((state) => state.memories);
  console.log(memories);
  return (
    <div>
    <Memory/>
    <Memory/>
    </div>
  );
}
export default Memories;
